import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { useEffect, useState } from 'react';
import Axios from 'axios';

const CourseList = () => {
    const [rows, setRows] = useState([])
    useEffect(() => {
        Axios.get('http://localhost:3001/api/monhoc')
            .then(data => setRows(data))
            .catch(err => alert(err))
    }, [])


    return (
        <TableContainer container={Paper}>
            <Table style={{ minWidth: "650px" }}>
                <TableHead>
                    <TableRow>
                        <TableCell>Mã môn học</TableCell>
                        <TableCell align="right">Tên môn học</TableCell>
                        <TableCell align="right">Số tín chỉ</TableCell>
                        <TableCell align="right">Bộ môn</TableCell>
                        <TableCell align="right">Phân loại</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map(row => (
                        <TableRow key={rows.name}>
                            <TableCell component="th" scope="row">
                                {row.mamh}
                            </TableCell>
                            <TableCell align="right">{row.tenmh}</TableCell>
                            <TableCell align="right">{row.sotinchi}</TableCell>
                            <TableCell align="right">{row.bomon}</TableCell>
                            <TableCell align="right">{row.phanloai}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}

export default CourseList
